import React, { Component } from 'react';
import Title from '../Title'
import CartColumns from './CartColums';
import EmptyCart from "./EmptyCart"
import { ProductConsumer } from '../../content'
import CartList from './CartList';

export default class Cart extends Component {
    render() {

        return (
            <section>
                <ProductConsumer>

                {
                    value=>{

                        const{cart} = value;
                        if(cart.length > 0){

                            return (
                                <React.Fragment>
                                <Title type="Your" title="Cart"></Title>
                                <CartColumns />
                                <CartList />
                                </React.Fragment>
                            );
                        }
                        
                        else{

                            return(<EmptyCart/>);
                        }
                    }
                }

                
                </ProductConsumer>
 
            </section>
        );
    }

}
